    <style>
        * {
            transition: all 0.15s;
            -webkit-transition: all 0.15s;
            -ms-transition: all 0.15s;
        }

        html,
        body,
        .container,
        model-viewer {
            margin: 0;
            height: 100%;
            width: 100%;
            overflow: hidden;
            background-color: #353535;
        }

        hr {
            width: 100%;
        }

        .slider-container,
        .container {
            display: flex;
            flex-direction: row;
            align-items: center;
        }

        body {
            display: flex;
            justify-content: center;
            align-items: center;
        }

        model-viewer {
            min-height: 500px;
        }

        .right-container {
            font-family: Roboto, Helvetica, Arial, sans-serif;

            display: flex;
            flex-direction: column;
            background-color: #222;
            color: #fff;
            height: 100%;
            min-width: 360px;
            max-width: 360px;
        }

        .title-bar {
            padding: 20px 0px;
            background-color: #222;
            text-align: center;
            font-family: Helvetica, sans-serif;
            font-size: 3em;
            letter-spacing: 10px;
            font-weight: bolder;
            color: #fff;
            text-decoration: none;
        }

        .title-bar:hover {
            opacity: 0.6;
        }


        .control-panel {
            display: flex;
            flex-direction: column;
            height: 100%;
            overflow-x: hidden;
            overflow-y: scroll;
        }

        .dropdown {
            background-color: transparent;
            padding: 15px 20px;
            font-size: 1.25em;
            font-weight: 400;
            color: #fff;
            text-align: left;
            border: none;
            cursor: pointer;
            width: 100%;
            display: flex;
            justify-content: space-between;
        }

        .controls {
            padding: 20px;
            background-color: #333;
            display: none;
        }

        .slider-container {
            justify-content: space-between;
            height: 40px;
            margin: 0 5px;
        }

        button[type=reset] {
            background-color: #444;
            color: white;
            font-size: 1.1em;
            border: none;
            border-radius: 3px;
            width: 100%;
            height: 30px;
            cursor: pointer;
            margin-top: 15px;
        }

        button[type=reset]:hover {
            background-color: #666;
        }

        .value-container {
            border-radius: 3px;
            background-color: #444;
            border: none;
            font-size: 0.9em;
            text-align: center;
            line-height: 30px;
            width: 30px;
            height: 30px;
            color: #fff;
        }

        .slider {
            margin: 0 20px;
            flex-grow: 1;
        }

        .control-label {
            color: #fff;
            min-width: 70px;
            max-width: 70px;
        }

        .download {
            margin: 30px 60px;
            padding: 10px 0;
            margin-top: auto;
            border: none;
            border-radius: 5px;
            background-color: #555;
            color: #fff;
            cursor: pointer;
            font-size: 2em;
        }

        .download:hover {
            background-color: #4682B4;
        }

        .disabled {
            opacity: 0.3;
            cursor: default;
        }

        .hidden {
            display: none;
        }

        .show {
            display: block;
        }
    </style>
